import React from 'react';

const Card = (props) => {
  return (
    <div className='tc bg-light-blue dib br3 pa3 ma2 grow bw2 shadow-5'>
      <img alt='cat' src={`https://robohash.org/${props.id}?200x200`}/>
      <div>
        <h2>{props.name}</h2>
        <p>{props.loves}</p>
      </div>
    </div>
  );
}

export default Card;
